function hilightSelectedYearFilters(){for(var a=document.getElementsByClassName("year-filter"),b=listVueApp.yearFilters,c=0;c<a.length;c++){var d=a[c];b.includes(d.dataset.year)?selectChip(d):deselectChip(d)}}function filterYears(){0!==listVueApp.yearFilters.length&&(listVueApp.selectedAlbums=listVueApp.selectedAlbums.filter(function(a){return listVueApp.yearFilters.includes(a.release_date.substr(0,4))}))}
function filterArtists(){0!==listVueApp.artistFilters.length&&(listVueApp.selectedAlbums=listVueApp.selectedAlbums.filter(function(a){return listVueApp.artistFilters.includes(a.artist)}))}function filterTags(){0!==listVueApp.tagFilters.length&&(listVueApp.selectedAlbums=listVueApp.selectedAlbums.filter(function(a){return listVueApp.tagFilters.every(function(b){return a.tags.map(function(a){return a.text}).includes(b)})}))}function filterAll(){filterYears();filterArtists();filterTags()}
addEventListenerToClass("filter-btn","click",function(a){window.yearFilterModal.close();window.artistFilterModal.close();window.tagFilterModal.close()});
addEventListenerToClass("clear-filters","click",function(a){switch(a.target.dataset.type){case "year":listVueApp.yearFilters=[];M.toast({html:"Year filters cleared",displayLength:2500});break;case "artist":listVueApp.artistFilters=[];M.toast({html:"Artist filters cleared",displayLength:2500});break;case "tag":listVueApp.tagFilters=[],M.toast({html:"Tag filters cleared",displayLength:2500})}listVueApp.resetSelectedAlbums();filterAll();hilightSelectedArtistFilters();hilightSelectedTagFilters();hilightSelectedYearFilters()});
function setURIparams(a,b){var c=new URL(document.location);if(0===b.length)return c.searchParams.delete(a),history.replaceState({},"",c);b=encodeURIComponent(b.join(",,"));c.searchParams.set(a,b);history.replaceState({},"",c)}function getURIparam(a){return(a=(new URL(document.location)).searchParams.get(a))?decodeURIComponent(a).split(",,"):[]};
